    import React from 'react';
    import '../styles/WishItem.css';

    const WishItem = ({ wish, selectWish }) => {
    return (
        <div className="wish-item" onClick={() => selectWish(wish)}>
        <h3>{wish.title}</h3>
        <p>{wish.description}</p>
        <div className="wish-details">
            <span className="category">{wish.category}</span>
            <span className="location">{wish.location}</span>
            <span className="date">{wish.date}</span>
        </div>
        </div>
    );
    };

    export default WishItem;
